import React from "react";

export default function EntryList({ entries }) {
  return (
    <div className="w-full max-w-2xl bg-white/80 backdrop-blur-lg rounded-2xl shadow-lg p-6 border border-pink-100">
      <h2 className="text-xl font-semibold mb-4 text-pink-600">üìù Journal Entries</h2>
      {entries.length === 0 ? (
        <p className="text-gray-500">No entries yet. Start journaling today! üí¨</p>
      ) : (
        <ul className="space-y-3">
          {entries.map((e, i) => (
            <li
              key={i}
              className="p-3 bg-white/90 rounded-xl shadow hover:shadow-md hover:scale-[1.01]"
            >
              <p className="text-gray-700">{e.text}</p>
              <div className="text-sm text-gray-500 mt-1 flex justify-between">
                <span>{e.date}</span>
                <span>
                  {e.emotion === "Happy"
                    ? "üòÑ Happy"
                    : e.emotion === "Sad"
                    ? "üò¢ Sad"
                    : "üòê Neutral"}
                </span>
              </div>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
